import styled from 'styled-components'
import DeleteIcon from '../../../../../assets/img/update/close2.svg'

const StyledDeleteIcon = styled.div`
  display: inline-block;
  width: 10px;
  height: 10px;
  cursor: pointer;
  margin-right: 5px;
  position: relative;
  background: url(${DeleteIcon}) center center no-repeat;
`
export default StyledDeleteIcon
